import './style.css';
import likeIcon from '../../image/save.svg';

export function Card({name, price, discount, wigth, description, picture}) {
  return (
    <article className='card'>
      <div className="card__sticky card__sticky_type_top-left">
        <span className="card__discount">{`-${discount}%`}</span>
      </div>
      <div className="card__sticky card__sticky_type_top-rigth">
        <button className="card__favorite">
          <img src={likeIcon} alt="" className='card__favorite-icon'/>
        </button>
      </div>

      <a href="#" className="card__link">
        <img src={picture} alt={name} className="card__image" />
        <div className="card__desc">
          <span className={discount !== 0 ? "card__old-price" : "card__price"}>{price}&nbsp;P</span>
          {discount !== 0 && <span className="card__price card__pricetype_discount">{price}&nbsp;P</span>}
        </div>
      </a>
    </article>
  );
  }






